const ContactForm = ({ formLabelColor, inputBorderColor, inputTextColor }) => {
  const router = useRouter();

  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    company: "",
    service: "",
  });

  const [formStatus, setFormStatus] = useState("idle");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      await axios.post("/api/contact-form", formData);
      setFormStatus("success");
    } catch (error) {
      console.log(error);
      setFormStatus("error");
    }
  };

  if (formStatus === "success") {
    return (
      <div className="flex justify-center text-center my-10 text-white">
        <h4 className="font-medium">
          Thank you for your submission, <br /> you&apos;ll hear back from us
          soon!
        </h4>
      </div>
    );
  }

  if (formStatus === "error") {
    return (
      <div className="flex justify-center text-center my-10 text-white">
        <h4 className="font-medium">
          There was an error with your submission - we apologize for the
          inconvenience. Please try again or contact us directly at 914-237-7898
          or info@ewfny.com
        </h4>
      </div>
    );
  }

  return (
    <form
      className="flex flex-col relative pb-14 z-[2] gap-12"
      onSubmit={handleSubmit}
      action="#"
      method="POST"
    >
      <div className="flex flex-col">
        <label className={"font-medium mb-2 " + formLabelColor} htmlFor="name">
          Name <span className="text-[red]">*</span>
        </label>
        <input
          required
          onChange={handleChange}
          className={
            "py-2 bg-theme-100 bg-opacity-0 text-md border-b rounded-none " +
            inputBorderColor +
            " " +
            inputTextColor
          }
          id="name"
          name="name"
          type="text"
        />
      </div>
      <div className="flex flex-col">
        <label
          className={"font-medium mb-2 rounded-none " + formLabelColor}
          htmlFor="email"
        >
          Email <span className="text-[red]">*</span>
        </label>
        <input
          required
          onChange={handleChange}
          className={
            "py-2 bg-theme-100 bg-opacity-0 text-md border-b rounded-none " +
            inputBorderColor +
            " " +
            inputTextColor
          }
          id="email"
          type="email"
          name="email"
        />
      </div>
      <div className="flex flex-col">
        <label className={"font-medium mb-2 " + formLabelColor} htmlFor="phone">
          Phone <span className="text-[red]">*</span>
        </label>
        <input
          required
          onChange={handleChange}
          className={
            "py-2 bg-theme-100 bg-opacity-0 text-md border-b rounded-none " +
            inputBorderColor +
            " " +
            inputTextColor
          }
          id="phone"
          name="phone"
          type="tel"
        />
      </div>
      <div className="flex flex-col">
        <label
          className={"font-medium mb-2 " + formLabelColor}
          htmlFor="company"
        >
          Company
        </label>
        <input
          onChange={handleChange}
          className={
            "py-2 bg-theme-100 bg-opacity-0 text-md border-b rounded-none " +
            inputBorderColor +
            " " +
            inputTextColor
          }
          id="company"
          name="company"
          type="text"
        />
      </div>
      <div className="flex flex-col">
        <label
          className={"font-medium mb-2 " + formLabelColor}
          htmlFor="service"
        >
          Service
        </label>
        <select
          onChange={handleChange}
          className={
            "py-2 bg-theme-100 bg-opacity-0 text-md border-b rounded-none " +
            inputBorderColor +
            " " +
            inputTextColor
          }
          id="service"
          name="service"
        >
          <option>Installation</option>
          <option>Repair</option>
          <option>Refinishing</option>
          <option>Maintenance</option>
        </select>
      </div>
      <button
        className="flex text-left font-bold text-theme-300 gap-4 max-w-max "
        type="submit"
      >
        <div>Send now</div>
        <div className="self-center">
          <SVGArrow fill="#979a6f" />
        </div>
      </button>
    </form>
  );
};

